#!/bin/python3
import time

'''
  To take an input of n indicating the money in hand and 
  and an array of cost of ice cream flavours. 
  Find the combination of 2 indices of the array, which can 
  be bought with the money in hand 
  :param money: The money in hand.
  :type money: int
  :param cost: The list containing the cost of each flavour of ice cream
  :type cost: list<int>
  :return: The 2 indices in cost array, pointing to the cost which can be bought with money in hand
  :rtype: str
'''
cache = dict()

def whatFlavours(money, cost):
  cache = {}
  for i in range(0, len(cost)):
    if money - cost[i] in cache:
      return f'{cache[money - cost[i]]} {i + 1}'
    cache[cost[i]] = i+1

